@media only screen and (min-width: 992px) {
    * {
        margin: 0;
    }

    html {
        overflow: auto;
        width: 100vw;
        height: 100vh;
    }::-webkit-scrollbar {
        display:none;
    }

    #sideNav {
        display: none;
    }

    #main {
        background: center no-repeat url("../images/HuskeyBackground.png"),rgb(60,100,177,0.06);
        height: 95vh;
        width: auto;
        justify-content: center;
        align-items: center;
        text-align: center;
        margin-bottom: 0vh;
    }

    #title {
        font-family: 'SF UI Display Light';
        color: lightgray;
        font-size: 45px;
        padding: 22vh 0vw 0vh 0vw;
        margin: 0vh 0vw 0vh 0vw;
    }

    #subtitle {
        font-family: 'SF UI Display Bold';
        color: #3C64B1;
        font-size: 100px;
        margin: 0vh 0vw 5vh 0vw;
    }

    #caption {
        font-family: 'SF UI Display Thin';
        color: #A9A9A9;
        font-size: 20px;
    }

    #gameWord {
        background-color: transparent;
        height: 95vh;
    }

    #gameTime{
        background-color: transparent;
        height: 95vh;
    }

    #passage, #passageTime{
        position: relative;
        vertical-align: text-top;
        display: flex;
        justify-content: center;
        align-items: center;
        text-align: left;
        min-height: 40vh;
        font-family: 'SF UI Display Light';
        font-size: 36px;
        line-height: 200%;
        color: #A0A0A0;
    }
    .charSpanTime {
        white-space: pre-wrap;
    }
    #body, #bodyTime {
        overflow: hidden;
        margin: 5vh 20vw;
        background-color: #FBFBFD;
        padding: 3vh;
        border-radius: 20px;
        height: 40vh;
    }

    span {
        margin: 1px;
    }

    .current {
        border-bottom: black, 1px;
        background-color: yellow;

    }

    .correct {
        background-color: #3c65b12a;

    }

    .incorrect{
        background-color: rgba(230, 123, 123, 0.473);
    }

    #inputArea {
        margin-top: -50vh;
        color:white;
        border: white;
        outline:none;
        resize: none;
        position: fixed;
        font-size: 1px;
    }

    .flex-container {
        display: flex;
        justify-content: center;
        align-items: center;
        font-family: 'Open Sans', sans-serif;
        font-size: xx-large;
    }


    .flex1, .flex2, .flex3 {
        margin: 0vh 5vw;
        display: flex;
        flex-direction: column ;
        font-weight: 700;
        color: dimgray;
        justify-content: center;
        align-items: center;
    }


    #miniFlex, #miniFlexTime {
        display: flex;
        flex-direction: column;
        height: 96px;
        width: 96px;
        font-size: 36px;
        font-family: "SF UI Display Medium";
        align-items: center;
        border-radius: 50%;
        background-color: #3C64B1;
        color: #FFFFFF;
    }

    #seconds, #secondsTime {
        font-size: 14px;
        font-family: "SF UI Display Thin";
    }

    #timer, #timerTime {
        margin-top: 13px;
        font-size: 36px;
        font-family: "SF UI Display Medium";
    }
    #speed, #speedTime, #accuracy, #accuracyTime {
        display: flex;
        padding: 0;
        margin: 0;
        font-size: 36px;
        font-family: "SF UI Display Medium";
        color: #3C64B1;
        background-color: #F6F6F7;
        border-radius: 20%;
        height: 96px;
        width: 96px;
        justify-content: center;
        align-items: center;

    }

    #time, #timeTime, #wpm, #wpmTime, #percent, #percentTime {
        padding: 0;
        margin: 0;
        font-size: 14px;
        font-family: "SF UI Display Ultralight";
        color: #3C64B1;
        margin-top: 2vh;;
    }
    .navLinks {
        /* display: flex; */
        margin: 2vh 0vh;
        padding: 0;
        justify-content: space-between;
        align-items: center;
        list-style: none;
    }

    .navLinks li {
        display: inline-block;
        padding: 0px 5vw;
        color: #3C64B1;
        font-family: "SF UI Display Light";
        font-size: 16px;
    }

    .buttonMode {
        cursor: pointer;
        text-decoration: none;
        background-color: transparent;
        color: #3C64B1;
        border:none;
    }


    header{
        z-index:1;
        position: sticky;
        top: 0;
        width: 80vw;
        height:5vh;
        min-height: 50px;
        background-color: #F4F5F4;
        display: flex;
        justify-content: space-between;
        align-items: center;
        padding: 0vw 10vw;
        margin: 0;
    }

    img {
        cursor: pointer;
        max-height: auto;
        width: 5vw;
    }

    button {
        font-size: 25px;
    }

