        border-radius:0.12em;
        box-sizing: border-box;
        text-decoration:none;
        font-family: "SF UI Display Light";
        color:#3C64B1;
        text-align:center;
        transition: all 0.2s;
    } */

    #options {
        width: 65px;
        height: 34px;
        position: relative;
        /* background-image: url("../images/SwitchBackground.png"); */
    }

    #options input {
        height: 0;
        width: 0;
        opacity: 0;
    }

    #darkIcon {
        position: absolute;
        right:5px;
        top: 4px;
        height: 23px;
        width: 17px;
        /* background-image: url("../images/darkIcon.png"); */
    }
    .slider {
        position: absolute;
        cursor: pointer;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        background-color: black;
        -webkit-transition: .4s;
        transition: .4s;
        border-radius: 34px;
    }

    .slider::before {
        position: absolute;
        height: 26px;
        width: 26px;
        left: 4px;
        bottom: 3px;
        background-color: white;
        -webkit-transition: .4s;
        transition: .4s;
        content: "";
        border-radius: 50%;
    }

    #options input:checked + .slider {
        background-color: #3C64B1;
    }

    #options input:checked + .slider:before {
        -webkit-transform: translateX(31px);
        -ms-transform: translateX(31px);
        transform: translateX(31px);
    }

    a.buttonLogIn:hover{
        color:grey;
        background-color:#FFFFFF;
        border:0.1em solid grey;
    }

    #flex-options {
        height: 80vh;
        display:flex;
        justify-content: space-between;
        align-items: center;
        overflow: hidden;
    }
    #timeMode, #wordMode {
        background-color: #FBFBFD;
        align-items: center;
        justify-content: center;
        width: 40vw;
    }

    #titleTime, #titleWord {
        color: #a0a0a052;
        font-family: "SF UI Display Bold";
        font-size: 240px;
    }

    #subtitleTime, #subtitleWord {
        color: #3C64B1;
        font-family: "SF UI Display Bold";
        font-size: 64px;
        margin-bottom: 2vh;
    }

    #captionTime, #captionWord {
        color: #A0A0A0;
        font-family: "SF UI Display Light";
        font-size: 18px;
        margin-bottom: 5vh;
    }

    #buttonTime, #buttonWord {
        cursor: pointer;
        background-color: #3C64B1;
        color: #FFFFFF;
        font-family: "SF UI Display Light";
        font-size: 18px;
        text-align:center;
        text-decoration: none;
        padding:0.35em 1.2em;
    }

    #divButtonTime, #divButtonWord{
        margin-bottom: 5vh;
    }
    #dividerTime, #dividerMode {
        margin:auto;
        text-align: center;
        width: 25vw;
    }

    .gameTitle {
        text-align: center;
        font-family: "SF UI Display Bold";
        font-size: 64px;
        color: #3C64B1;
        margin-bottom: 3vh;
        padding-top: 8vh;
    }

